const initState = {};

const channelReducer = (state = initState, action) => {
  switch (action.type) {
    case "CREATE_CHANNEL":
      console.log("created channel", action.channel);
      return state;
    case "CREATE_CHANNEL_ERROR":
      console.log("create channel error", action.err);
      return state;
    default:
      return state;
  }
};

export default channelReducer;
